import React from 'react'

const Navigation = (onRouteChange) => {
	return (
		<nav className="flex justify-end">
		  <p onClick={()=>onRouteChange("Login")} className="link f2 dim black underline">Sign Out</p>
		 </nav>
	);
}
export default Navigation;
